version = "0.0.6"
description = ""
category = "main"
optional = false
python-versions = ">=3.7,<4.0"

[package.source]
type = "file"
url = "../../dist/bearboto3-0.0.6-py3-none-any.whl"

[[package]]
name = "beartype"
version = "0.9.1"
description = "Unbearably fast runtime type checking in pure Python."
